import React from 'react'
import { Button, Carousel, Container } from 'react-bootstrap';
import runway from '../../../image/runway.jpg';
import whistler from '../../../image/Whistler1.jpg';
import winterbackground from '../../../image/winterbackground.png';
import photo from '../../../image/1346.png';
import "./style.css";

type Props = {};
type State = {};

export default class HomePage extends React.Component<Props, State> {

    state = {} as State;

    constructor(props: Props) {
        super(props);
    }

    onClickToProductList(){
        window.location.href='#/productlist'
    }
    onClickToWeather(){
        window.location.href='#/weather'
    }
    onClickToBus(){
        window.location.href='#/bus'
    }

    render() {
        return (
            <div className="homepage">
                <Container>
                    <Carousel>
                    <Carousel.Item>
                        <img
                            className="homepage"
                            src= {whistler}
                            alt="First slide"
                        />
                        <Carousel.Caption>
                            <h2 className="wordstyle">Your journey starts here</h2><br/>
                            <Button variant="dark" onClick={this.onClickToProductList}>Discover Here</Button>
                        </Carousel.Caption>
                    </Carousel.Item>
                    <Carousel.Item>
                        <img
                            className="homepage"
                            src={runway}
                            alt="Second slide"
                        />

                        <Carousel.Caption>
                            <h1 className="wordstyle">What's the weather like?</h1><br/>
                            <p className="wordstyle">Click below to get a weather forecast</p><br/>
                            <Button variant="dark" onClick={this.onClickToWeather}>Check Now</Button>
                        </Carousel.Caption>
                    </Carousel.Item>
                    <Carousel.Item>
                        <img
                            className="homepage"
                            src={winterbackground}
                            alt="Third slide"
                        />

                        <Carousel.Caption>
                            <h3 className="wordstyle">Visit us?</h3><br/>
                            <Button variant="dark" onClick={this.onClickToBus}>Find Us</Button>
                        </Carousel.Caption>
                    </Carousel.Item>
                </Carousel>
                </Container>
                
            </div>
        )
    }
}
